(function () {
  var eh_exp = {
    client: "WHM",
    exp: "WaysToGivePage",
    var: "varA",
    waitUntil: function (predicate, success, error, waitTime = 10000) {
      let int = setInterval(function () {
        if (predicate()) {
          clearInterval(int);
          int = null;
          success();
        }
      }, 500);
      setTimeout(function () {
        if (int !== null) {
          clearInterval(int);
          if (typeof error === "function") {
            error();
          }
        }
      }, waitTime);
    },
    waitForPromise: function (predicate, waitTime = 500) {
      return new Promise(function waitToResolve(resolve) {
        if (predicate()) {
          resolve();
        } else {
          setTimeout(function () {
            waitToResolve(resolve);
          }, waitTime);
        }
      });
    },
    build: function () {
      var { waitUntil, waitForPromise } = this;
      var scope = {
        data: {
          cta: {
            name: "Continue",
            href: "/",
          },
        },
        mainHTML: function (scope) {
          return `
                <div class="eh-container container">
                    <div class="eh-monthly">
                      
                        <div class="eh-image-bg"></div>
                        
                        <div class="eh-btn-container eh-btn-container--monthly">
                            <div class="eh-content">
                                <div class="eh-header">
                                    <h1>${scope.monthly.header}</h1>
                                </div>
                                <div class="eh-copy">
                                    <p>${scope.monthly.copy}</p>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div class="eh-oneTime">
                        <div class="eh-image-bg"></div>
                
                        <div class="eh-btn-container eh-btn-container--oneTime">
                            <div class="eh-content">
                                <div class="eh-header">
                                    <h1>${scope.oneTime.header}</h1>
                                </div>
                                <div class="eh-copy">
                                    <p>${scope.oneTime.copy}</p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
		    `;
        },
        mainCSS: function () {
          return `
						.eh-exp[EH_${this.exp}] {
							#buttons_1 
                                display: none !important;
                            }
                            .eh-container{
                                cursor: pointer;
                                max-width: 1140px;
                                display: flex;
                                flex-direction: row;
                                justify-content: space-between;
                                align-items: center;
                                padding-bottom: 4rem;
                                padding-top: 3rem;
                            
                                @media screen and (max-width: 768px) {
                                    flex-direction: column;
                                }   

                                & > div{
                                    height: 602px;
                                    width: 47.5%;
                                    
                                    display: flex;
                                    align-items: end;

                                    position: relative;

                                    @media screen and (max-width: 768px) {
                                        max-width: 400px;
                                        width: 100%;
                                        margin-bottom: 1rem;
                                        height: 450px;
                                    }   
                                  

                                    &.eh-monthly{
                                        background: linear-gradient(180deg, rgba(120, 29, 126, 0) 40%, #781D7E 100%);

                                        .eh-image-bg{
                                            background-size: cover;
                                            background-image: url(data:image/jpeg;base64,);
                                        }
                                    }
                                    &.eh-oneTime{
                                        background: linear-gradient(180deg, rgba(103, 194, 33, 0) 40%, #67C221 100%);

                                        .eh-image-bg{
                                            background-image: url(data:image/png;base64,);

                                        }
                                    }

                                    .eh-image-bg {
                                        position: absolute;
                                        width: 100%;
                                        height: 100%;
                                        top : 0;
                                        left : 0;
                                        z-index: -1;

                                        background-position: center;
                                        background-repeat: no-repeat;

                                    }
                                }

                                .eh-btn-container{

                                    z-index: 10;
                                    color: #fff;
                                    margin: 1rem 2rem;

                                    h1{
                                        font-size: 3rem;

                                        span{
                                            white-space: pre;

                                            @media screen and (min-width: 789px) and (max-width: 1000px) {
                                                white-space: normal;
                                            }
                                        }

                                        @media screen and (max-width: 1000px) {
                                            font-size: 36px;
                                        }   
                                    }

                                    p{
                                        color: #fff;
                                        font-size: 1.15rem;

                                        span{
                                            white-space: pre;
                                                
                                                @media screen and (min-width: 789px) and (max-width: 1000px) {
                                                    white-space: normal;
                                                }
                                        }

                                        @media screen and (max-width: 768px) {
                                            font-size: 14px;
                                        }                   
                                    }

                                }
                            }
						}
					`;
        },
        mainJS: function () {
          const scope = {
            monthly: {
              link: "https://welcomehallmission.com/ways-to-give/shelter-food-love/",
              header: "Become a <span>monthly donor.</span>",
              copy: "You can provide ongoing support for Montrealers in need, directly funding life-changing services. Your monthly gift creates lasting change and brings hope to those struggling in Montreal.",
            },
            oneTime: {
              link: "https://welcomehallmission.com/?form=365EN",
              header: "Give a <span>one time gift.</span>",
              copy: "Your one-time gift can open the door to life-changing support for those in need. By giving today, you help provide hope, dignity, and a path forward for struggling Montrealers at Welcome Hall Mission.",
            },
          };

          const elDonationBtmContainer = document.querySelector("#buttons_1");
          const elMonthlyDonationCta =
            elDonationBtmContainer.querySelector("a.btn-monthly");
          const elOneTimeDonationCta =
            elDonationBtmContainer.querySelector("a.btn-donate");

          // Control cta hide
          elDonationBtmContainer.style.display = "none";
          elMonthlyDonationCta.style.display = "none";
          elOneTimeDonationCta.style.display = "none";

          !document.querySelector(".eh-container") &&
            elDonationBtmContainer.insertAdjacentHTML(
              "afterend",
              this.mainHTML(scope)
            );

          waitUntil(
            function () {
              return (
                document.querySelector(".eh-container") &&
                document.querySelector(".eh-oneTime") &&
                document.querySelector(".eh-monthly")
              );
            },
            function () {
              const elNewMonthlyCta = document.querySelector(".eh-monthly");
              const elNewOnTimeCta = document.querySelector(".eh-oneTime");

              elNewMonthlyCta.addEventListener("click", () => {
                elMonthlyDonationCta.click();
              });
              elNewOnTimeCta.addEventListener("click", () => {
                elOneTimeDonationCta.click();
              });
            }
          );
        },
      };

      !document.querySelectorAll(`.eh-${this.exp}-css`).length &&
        document.head.insertAdjacentHTML(
          "beforeend",
          `<style class="eh-${this.exp}-css">${scope.mainCSS()}</style>`
        );

      waitForPromise(function () {
        return document.querySelector("#buttons_1");
      }).then(function () {
        scope.mainJS();
      });
    },
    isTargetUrls: function () {
      return ["/ways-to-give"].some((url) =>
        window.location.pathname.includes(url)
      );
    },
    injectFlicker: function () {
      var css = "section { opacity: 0 !important; }";
      var head = document.head || document.getElementsByTagName("head")[0];
      var style = document.createElement("style");
      style.type = "text/css";
      style.id = "eh-flicker";
      style.appendChild(document.createTextNode(css));
      head.appendChild(style);
      setTimeout(function () {
        let elFlicker = document.getElementById("eh-flicker");
        elFlicker && elFlicker.parentNode.removeChild(elFlicker);
      }, 5000);
    },
    manipulateDOM: function () {
      window.EH = window.EH || {};
      window.EH[this.exp] = this.var;
      document.body.classList.add("eh-exp");
      document.body.setAttribute(`EH_${this.exp}`, this.var);
      this.build();

      // Flicker removal
      let elFlicker = document.getElementById("eh-flicker");
      elFlicker && elFlicker.parentNode.removeChild(elFlicker);
    },
    revealExperiment: function () {
      setTimeout(() => {
        let elFlicker = document.getElementById("eh-flicker");
        elFlicker && elFlicker.parentNode.removeChild(elFlicker);
      }, 500);
    },
    init: function () {
      if (!this.isTargetUrls()) {
        delete window.EH[this.exp];
        document.body.removeAttribute(`EH_${this.exp}`);
      } else {
        this.injectFlicker(); // Comment out if flicker not needed
        this.manipulateDOM();
        this.revealExperiment();
      }
    },
  };
  eh_exp.waitUntil(
    function () {
      return document.querySelector("body");
    },
    function () {
      eh_exp.init();
    }
  );
})();
